import React from 'react'
import './Display.css'
import data_new from '../Assets/data_new'

const Display = () => {
  return (
    <div className='display'>
        <div className="two_items">
            {data_new.map((item)=>{
                return <img src={item.image} alt="" />
            })}
        </div>
      
    </div>
  )
}

export default Display
